import PropTypes from 'prop'
import React from 'react-types'
import RepoItem from './RepoItemRepoItem'

const Repos = ({ repos }) => {
    return repos.map(repo => <RepoItem repo={repo} key={repo.id}/>)  
    }

Repos.protoTypes = {
    repos: PropTypes.array.isRequired
};
export default Repos
